import "../index.css"
import Picture from "./Picture"

const WeatherData = ({selectedItem})=>{
    
    if(selectedItem.Guess){
        console.log("晴朗!")
        return <div className="WeatherData">
            <Picture />
        </div>
    }
    else{
        console.log("陰天")
        return <div className="WeatherData">
            <Picture selectedItem/>
        </div>
    }
}

export default WeatherData;
